import React from 'react';
import images from './images/food1.jpg'

class Home extends React.Component{
    constructor(props) {
        super(props);

        // this.state = {

        // }

      }

      render(){
          return(
              <div>
                  <img src={images} object-fit="cover"></img>
                  <div class="site-blocks-cover overlay" style="background-image: url(images/hero_bg_2.jpg);" data-aos="fade" data-stellar-background-ratio="0.5" id="section-home">
      <div class="container">
        <div class="row align-items-center justify-content-center text-center">

          <div class="col-md-8" data-aos="fade-up" data-aos-delay="400">


            <h1 class="text-white font-weight-light text-uppercase font-weight-bold" data-aos="fade-up">We Make Shipping</h1>
            <p class="mb-5" data-aos="fade-up" data-aos-delay="100">A Logistics Company</p>
            <p data-aos="fade-up" data-aos-delay="200"><a href="https://free-template.co" class="btn btn-primary py-3 px-5 text-white">Get Started!</a></p>

          </div>
        </div>
      </div>
    </div> 
              </div>
          )
      }
}

export default Home;
